import { Component,OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { HttpClient ,HttpHeaders} from '@angular/common/http';
import { Router } from '@angular/router';
@Component({
  selector: 'app-delete-task',
  templateUrl: './delete-task.component.html',
  styleUrls: ['./delete-task.component.css']
})
export class DeleteTaskComponent implements OnInit{

  taskId:number;
  projectId:number;
  constructor(private formBuilder: FormBuilder,private http : HttpClient,private router :Router) { }
  ngOnInit(): void {

  }

  DeleteTask(){

    this.http.delete('http://localhost:8083/api/task/delete/'+this.projectId+'/task/'+this.taskId).subscribe((response)=>{
      console.log(response);
    })
  }

}

<form (ngSubmit)="DeleteTask()">
    <div class="user">
    <h1>Delete Task</h1>
    <label>Enter Project Id</label>
    <input type="number"  id="userId" name="userId" [(ngModel)]="projectId">
    <label>Enter Task Id</label>
    <input type="number"  id="userId" name="taskId" [(ngModel)]="taskId">
    <br>
    <p *ngIf="isCreated">Task is created successfully</p>
    <button class="user-button" type="submit">Confirm</button>
    </div>
</form>
